PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS people (
      id INTEGER PRIMARY KEY AUTOINCREMENT,
      first_name TEXT NOT NULL,
      last_name TEXT NOT NULL,
      avatar TEXT,
      bio TEXT,
      is_civ INTEGER DEFAULT 0,
      created_at DATETIME DEFAULT CURRENT_TIMESTAMP
    , is_admin INTEGER DEFAULT 0, admin_code TEXT);
CREATE TABLE IF NOT EXISTS relationships (id INTEGER PRIMARY KEY AUTOINCREMENT, person1_id INTEGER NOT NULL, person2_id INTEGER NOT NULL, intensity TEXT DEFAULT 'kiss', date TEXT, context TEXT, created_at DATETIME DEFAULT CURRENT_TIMESTAMP, UNIQUE(person1_id, person2_id));
CREATE TABLE IF NOT EXISTS ideas (id INTEGER PRIMARY KEY AUTOINCREMENT, sender_id INTEGER NOT NULL, content TEXT NOT NULL, created_at DATETIME DEFAULT CURRENT_TIMESTAMP, FOREIGN KEY (sender_id) REFERENCES people(id) ON DELETE CASCADE);
DELETE FROM sqlite_sequence;
CREATE INDEX idx_ideas_sender ON ideas(sender_id);
CREATE INDEX idx_ideas_created ON ideas(created_at DESC);
COMMIT;
